const ListItem = ({item}) => {

    const loadPokemonsDetails = () => {
        fetch(item)
        .then(response => response.json())
        .then(data => {
            return
        })
    }

    useEffect(() => {
        loadPokemonsDetails()
    })

    return ( 
        <div>
            {item}    
        </div>
    );
}

export default ListItem;
